PRAGMA foreign_keys=OFF;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE _shared_version (name TEXT PRIMARY KEY, version INTEGER);
CREATE TABLE home_stories (feed_type TEXT, fetched_at TEXT, cursor TEXT, dedup_key TEXT, sort_key TEXT, ranking_weight REAL, features_meta TEXT, feed_edge_meta BLOB, disallow_first INTEGER, seen_state INTEGER, image_seen_state INTEGER, see_first_state INTEGER, row_type INTEGER, story_data BLOB, story_type TEXT, cache_file_path TEXT, cache_file_offset INTEGER, cache_file_data_length INTEGER, unit_position_in_flatbuffer INTEGER, mutation_data BLOB, mutation_supported INTEGER, client_sort_key TEXT, client_cursor TEXT, cache_id TEXT, story_ranking_time TEXT, story_bump_reason TEXT, story_id TEXT, cache_tree_file_path TEXT, PRIMARY KEY (feed_type, dedup_key));
CREATE TABLE home_stories_media (dedup_key TEXT, media_type TEXT, media_cache_state INTEGER, media_id TEXT, PRIMARY KEY (dedup_key, media_type, media_id));
CREATE INDEX home_stories_cursor_index ON home_stories (cursor);
CREATE INDEX home_stories_sort_key_index ON home_stories (sort_key);
CREATE INDEX home_stories_seen_state_index ON home_stories (seen_state);
CREATE INDEX home_stories_client_sort_key_index ON home_stories (client_sort_key);
CREATE INDEX home_stories_client_cursor_key_index ON home_stories (client_cursor);
CREATE INDEX home_stories_story_type_index ON home_stories (story_type);
CREATE INDEX cache_id_index ON home_stories (cache_id);
CREATE INDEX dedup_key_index ON home_stories_media (dedup_key);